original_question:
Uwanja wa mstatili umezungukwa na uwanja wa michezo, kama inavyoonyeshwa hapa chini. Uwanja huo unajumuisha kingo mbili za uwanja, na nusu duara mbili. Urefu wa uwanja ni mita 400. Je, ni eneo gani kubwa zaidi la uwanja, kwa mita za mraba?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

